import React from 'react';
import {View, TouchableOpacity, Text, TextInput} from 'react-native';
import style from './style.js';

const usuarios = [
    {
        "login": "zeroberto",
        "senha": "1234",
        "detatlhes":"Sou um cara legal"
    },
    {
        "login": "humberto",
        "senha": "1234",
        "detatlhes":"Esse cara sou eu"
    },
    {
        "login": "doisberto",
        "senha": "1234",
        "detatlhes":"Apenas mais um cara"
    }
]

export default function Login({navigation}){

    return(
        <View style={style.body}>
            <View>
                <Text style={style.header}>Login</Text>
            </View>
            <View style={style.inputs}>
                <TextInput style={style.input} placeholder="login" value={user}/>
                <TextInput style={style.input} secureTextEntry={true} placeholder="senha"/>
            </View>
            <TouchableOpacity style={style.btn}>
                <Text style={style.btnText}>Entrar</Text>
            </TouchableOpacity>
        </View>
    )
}
